    <div>

      <div>
        <img src={item.image}></img>
      </div>

      <div>
        <h1>{item.title}</h1>
        <h1>{item.description}</h1>
      </div>

      <div>
        <p>{item.price}</p>
        <div>
          <FcDeleteDatabase></FcDeleteDatabase>
        </div>
      </div>

    </div>
  )
};

export default CartItem;
